test.data_created_correctly.no_population <- function () {
  test.mrp <- mrp(yes.of.all ~ state+age+edu,
          poll=testData(), poll.weights="weight")
  
  checkEquals (expectedTestMrp.Data(), test.mrp@data)
  checkEqualsNumeric (expectedTestMrp.DefaultPopulationData(), test.mrp@population@.Data)
}

test.data_created_correctly.with_population <- function () {
  test.mrp <- mrp(yes.of.all ~ state+age+edu,
      poll=testData(), poll.weights="weight",
      population=testPopulation(), use="weighted2008")
  

  checkEquals (expectedTestMrp.Data(), test.mrp@data)
  checkEqualsNumeric (expectedTestMrp.PopulationData(), test.mrp@population@.Data)
}



